import Link from 'next/link';

const linkStyle = {
  fontSize: 35
};

const Header = () => (
  <nav>
    <Link href="/">
      <a className="navbar-brand" style={linkStyle}>Les recettes de Martine</a>
    </Link>
    <ul>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
  </nav>
);

export default Header;
